    "Badger productivity, contaminant, and health study",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-08-30T12:24:55.749199",nt"name": "badger-productivity-contaminant-and-health-study",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service has
    prepared a proposal to conduct a badger study on the Arsenal with emphasis on contaminant
    exposure and reproductive affects. This study involves the use of telemetry technology
    to track adult female badgers to determine foraging areas, use of contaminated areas,
    contaminant exposure, and productivity. As currently planned by the Service, the
    study would last at least two years and would be conducted by a graduate student.
    The Service believes that the badger is an ideal species to study on the Arsenal
    because of its natural history. Objectives for the study are to determine: 1)if
    there is a significant difference in reproductive success of female badgers that
    forage in contaminated areas vs. females that forage in clean areas on the Arsenal;
    2) if there are significant differences in the occurrence of pathologic conditions
    in select tissues of juvenile badgers; 3) if the concentrations of contaminants
    in juvenile badger from females that forage in contaminated areas is significantly
    higher than juveniles badgers from females that forage in clean areas on the Arsenal;
    4) if organochlorine pesticide compounds in subcutaneous fat samples from female
    badgers that forage in contaminated areas is significantly higher than in female
    badgers that forage in clean areas on the Arsenal; 5) if there is a significant
    difference in contaminant concentrations in badger prey items from contaminated
    and clean areas on the Arsenal; and to 6) Identify other factors, unrelated to contaminants,
    that may affect reproductive success (ie. prey abundance).",nt"license_title":
